import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header'; // Import Header component
import HomePage from './pages/HomePage'; // HomePage containing OurServices
import DetailsPage from './pages/DetailsPage';
import AmbulanceDetailsPage from './pages/AmbulanceDetailsPage';

import DoctorForm from './pages/DoctorForm'; // Doctor Registration Form
import PatientForm from './pages/PatientForm'; // Patient Registration Form

import './App.css'; // Centralized CSS for all styles

function App() {
  return (
    <Router>
      {/* Header displayed across all pages */}
      <Header />

      <Routes>
        {/* HomePage route where OurServices is included */}
        <Route path="/" element={<HomePage />} />

        {/* Hospital and Ambulance Details Pages */}
        <Route path="/details/:hospitalId" element={<DetailsPage />} />
        <Route path="/ambulance/details/:ambulanceId" element={<AmbulanceDetailsPage />} />

        {/* Doctor and Patient Registration Forms */}
        <Route path="/doctor-form" element={<DoctorForm />} />
        <Route path="/patient-form" element={<PatientForm />} />
      </Routes>

      {/* Sections for Home and Services */}
      <section id="home">
        <h2>Home Section</h2>
        <p>Welcome to our website!</p>
      </section>

      <section id="services">
        <h2>Our Services</h2>
        <p>These are the services we offer...</p>
      </section>
    </Router>
  );
}

export default App;
